import React from 'react'
import brand_img from '../img/brand_img.jpg'
import {Routes, Route ,Link} from "react-router-dom";
import './Navbar.css'
//import db from '../d.json'
import Home from './Hotel'
import Offer from '../Offer'
import Help from '../Help'
import Hotelmenu from './Hotelmenu'
import { useState,useEffect } from 'react';
import axios from "axios";
function Navbar() {
  const[restaurants,setrestaurants]=useState([])
  useEffect(()=>{
    async function fetchRestaurants()
    {
      const {data}=await axios.get('/api/restaurants/')
      setrestaurants(data)
    }
    fetchRestaurants()
  },[])
const obj=[{'name':'No Item Found','path':'../pictures/no-item.jpg'}]
const[value,setvalue]=useState(true)
const[align,setalign]=useState("left")
const[color,setcolor]=useState('white')
const[colornav,setnavcolor]=useState('white')
function togglemode()
{
  if(color==="black")
  {
    setnavcolor('light')
    setcolor('white')
  }
  else if(color==="white")
  {
    setnavcolor('dark')
    setcolor('black')
  }
}

  function search(data){
    setalign("center")
    setvalue(true)
    if(data==="")
    {
    console.log('nothing')
     let news=restaurants
     setrestaurants([...news])
     alert(restaurants)
    }
    else
{
    let news= restaurants.filter((i)=>
    {
        if(i.name.toLowerCase().indexOf(data)!==-1)
        {
            return true
        }
        else
        {

            return false
        }
    })
    if(news.length===0)
    {
      setrestaurants([...obj])
      setvalue(false)
      setalign("center")
    
    }
    else{
        setrestaurants([...news])
}
}  
  }
  return (
    <><nav className={`navbar navbar-expand-lg bg-body-tertiary fixed-top bg-${colornav} text-${colornav==='dark'?'light':'dark'}`}>
    <div className="container-fluid">
      <Link className="navbar-brand ml-5" to="/">
        <img src={brand_img} height="60px" className="rounded-circle" alt="brand_img"/>
        <span className="font-weight-bold" style={{fontFamily:"Verdana, Geneva, Tahoma, sans-serif",color:`${color==='black'?'white':"#6b3a1b"}`}}> Food
          Order</span>
      </Link>
      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav"
        aria-controls="navbarNav" aria-expanded="false">
        <span><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-list" viewBox="0 0 16 16">
            <path fill-rule="evenodd"
              d="M2.5 12a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5zm0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5zm0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5z" />
          </svg></span>
      </button>
      <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
        <ul className="navbar-nav">
          <li className="nav-item pl-3">
            <div className="dropdown nav-link">
              <form className="d-flex" role="search" autocomplete="off" autocapitalize="Link-zA-Z0-9">
                <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" style={{width:"80%",height:"80%"}} onChange={(e)=>{search(e.target.value)}}
            />
                <button className="btn btn-outline-warning"><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16"
                    fill="currentColor" className="bi bi-search" viewBox="0 0 16 16">
                    <path
                      d="M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001c.03.04.062.078.098.115l3.85 3.85a1 1 0 0 0 1.415-1.414l-3.85-3.85a1.007 1.007 0 0 0-.115-.1zM12 6.5a5.5 5.5 0 1 1-11 0 5.5 5.5 0 0 1 11 0z" />
                  </svg></button>
              </form>
            </div>
          </li>
          <li className="nav-item pl-3">
            <Link className="nav-link" to="/Offer" style={{color:`${color==='black'?'white':'black'}`}}><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16"
                fill="currentColor" className="bi bi-percent" viewBox="0 0 16 16">
                <path
                  d="M13.442 2.558a.625.625 0 0 1 0 .884l-10 10a.625.625 0 1 1-.884-.884l10-10a.625.625 0 0 1 .884 0zM4.5 6a1.5 1.5 0 1 1 0-3 1.5 1.5 0 0 1 0 3zm0 1a2.5 2.5 0 1 0 0-5 2.5 2.5 0 0 0 0 5zm7 6a1.5 1.5 0 1 1 0-3 1.5 1.5 0 0 1 0 3zm0 1a2.5 2.5 0 1 0 0-5 2.5 2.5 0 0 0 0 5z" />
              </svg> Offers</Link>
